BeginPackage["MathWorld`Life`",{"Utilities`FilterOptions`"}]

Bits::usage =
"Bits[l] returns the number of live cells in the given matrix.  \
Bits[{l1,l2,...}] returns the number of live cells in each form \
together with the minimum number of live cells.  Bits[l,n] uses \
generations 0 through n-1."

BoundingBox::usage =
"BoundingBox[lifeform] returns the size of the box bounding the specified \
lifeform."

CellGraphics::usage =
"CellGraphics[list,opts] returns a graphics object corresponding to list."

CellMatrix::usage =
"CellMatrix[string,opts] reads a life object with name \"string\" \
from the default ASCII life dictionary file and outputs a matrix \
of 0's and 1's.  If LifeFile->{file1,...} is specified, use the specified \
files instead.  LifeFile can also be specified as a single string.  \
PrintFilename->True|False is another option.  This command should be \
considered obsolete and Configuration[string] should be used instead, as \
it contains well-defined configurations in matrix format and does not have \
to read and parse external files."

CellText::usage =
"CellText[lifeform] returns an ASCII representation of the specified life form."

Configuration::usage =
"Configuration[string] gives a binary matrix representation of the named life \
configuration.  For example, Configuration[\"block\"] gives a matrix representing \
the block blinker."

Generation::usage =
"Generation[lifeform,g] returns a matrix corresponding to the gth \
generation of l.  This is obsoleted by Life[lifeform,{g}]."

GenerationNext::usage =
"GenerationNext[lifeform] returns a matrix corresponding to the next \
generation of l.  This is obsoleted by Life[lifeform,1]."

Generations::usage =
"Generations[lifeform,n,p,strip] generated a graphics object of n \
generations (counting the initial one as generation 1) \
of pattern l with strip cells removed partitioned p to a row."

Life::usage =
"Life[m,g] gives g steps of the Life CA with initial condition given by \
the binary matrix m.  The initial (0th) generation is also included, giving \
a list of total length g+1.  Life[m,{g1,g2}] gives steps g1 to g2.  \
Life[m,{g}] gives step g.  The algorithm used is Mathematica 4.2's built-in \
CellularAutomaton command."

LifeArray::usage =
"LifeArray[ragged-list] returns a GraphicsArray object of individual life \
objects specified as a list of lists of strings.  All forms on a given row \
are padded to the same dimensions, and the name of each form is used as \
the plot title for each."

LifeMovie::usage =
"LifeMovie[lifeform,gen,padding] creates a list of Graphics objects for \
gen generations of the life configuration form having padding around the \
largest bounding box.  A padding of 1 is used if none is specified.  \
Use Show/@LiveMovie[...] to animate.  To export to an animated GIF, use \
Export[\"101.gif\",LifeMovie[Configuration[\"101\"],5],\"GIF\"]."

OscillationPeriod::usage =
"OscillationPeriod[m] gives the oscillation period for a life form with \
matrix representation m.  The options Spaceships->True|False \
and MaxIterations->maxits can be given.  Spaceships->False \
and MaxIterations->100 are the defaults."

Pad::usage =
"Pad[l,{x1,x2},{y1,y2}] returns a matrix padded on the four sides \
with a specified number of 0s.  Pad[l,<n>] returns a matrix padded by \
an n-cell border of 0s.  If n is omitted, 1 is assumed."

(*
PadBorder::usage =
"PadBorder[l,<n>] returns a matrix padded by an n-cell border of 0s.  \
If n is omitted, 1 is assumed."
*)

PrintFilename::usage =
"PrintFilename->True|False is an option to CellMatrix."

Spaceships::usage =
"Spaceships->True|False is an option to OscillationPeriod which checks \
if a congruent pattern is actually a spaceship.  This greatly slows \
the code at the moment."

Square::usage =
"Square[{x,y},r] generates a filled square."

StillLifeQ::usage =
"StillLifeQ[lifeform] returned True if the matrix is a still life."

StripBorder::usage =
"StripBorder[lifeform,<n>] returns a matrix stripped by an n-cell border."

SurroundCounts::usage =
"SurroundCounts[lifeform] returns a matrix of the number of cells surrounding \
each element of l."

Trim::usage =
"Trim[lifeform] returns the matrix lifeform with any blank cells around \
the border stripped out."


