Begin["`Private`"]

Bits[m_List?MatrixQ]:=Count[Flatten[m],1]

Bits[m_List]:=Bits/@m

Bits[m_List?MatrixQ,n_Integer?Positive]:=
	{#,{Min[#],Max[#]}}&[
		Bits[NestList[Trim[GenerationNext[#]]&,m,n-1]]
]

BoundingBox[l_List?MatrixQ]:=Reverse@Dimensions[Trim[l]]

(* should expand this to give the bounding box for oscillators *)

CellGraphics[l_List?MatrixQ,opts___]:=Module[
  {
    i,j,cells={},grid={},None={},
	ly=Length[l],lx=Length[l[[1]]],
    fn=Cell/.{opts}/.Options[CellMatrix],
    filename=LifeFile/.{opts}/.Options[CellMatrix],
    alive=Alive/.{opts}/.Options[CellMatrix],
    gridstyle=Grid/.{opts}/.Options[CellMatrix],
    r=.5 Radius/.{opts}/.Options[CellMatrix],
    gopts=FilterOptions[Graphics,opts]
  },
  Do[
	If[l[[j,i]]==1,AppendTo[cells,fn[{i,-j},r]]],
	{i,lx},{j,ly}
  ];
  If[gridstyle!={},
	grid=Flatten[{gridstyle,Join[
		Table[Line[{{.5,-i+.5},{lx+.5,-i+.5}}],{i,1,ly+1}], (* horiz *)
        Table[Line[{{i-.5,-.5},{i-.5,-ly-.5}}],{i,1,lx+1}]  (* vert *)
	]}]
  ];
  Graphics[Join[cells,grid],Evaluate[gopts],AspectRatio->Automatic]
]

(* Notes:

The beginning of life forms in a file is indicated by a line starting with
startchar.  This _must_ be present for the following to work.

*)

CellMatrix::file="Found in file `1`."
CellMatrix::search="Looking in `1``2`."

CellMatrix[object_String,opts___]:=Module[
  {
    fn=Cell /.{opts} /.Options[CellMatrix],
    filename=LifeFile /.{opts} /.Options[CellMatrix],
    dir=LifeDir /.{opts} /.Options[CellMatrix],
    alive=Alive /.{opts} /.Options[CellMatrix],
    dead=Dead /.{opts} /.Options[CellMatrix],
    printfilename=PrintFilename /. {opts} /.Options[CellMatrix],
    str="",i,p,
    file,temp,t,cells,max,lengths,
    startchar="-",silver
  },
  silver=False;
  If[Head[filename]===String,filename={filename}];
  For[i=1,i<=Length[filename],i++,
	If[printfilename,Message[CellMatrix::search,dir,filename[[i]]]];
	file=OpenRead[dir<>filename[[i]]];
  
	(* ignore header *)
	While[str=="" || StringTake[str,1]!=startchar,
		str=Read[file,String];
		If[!silver,silver=(str=="LIFE LEXICON")];
	(*	Print[str];*)
	];
	
(*	Print["str1:",str]; *)
  
	(* read until first object matching specification is reached *)
	(* there is a problem, e.g., conduit appears in Silver.lif before :conduit does *)
	
	(* str is a list of Strings *)
	While[str=="" ||
		If[StringTake[str,1]==":",
			StringTake[str,Min[StringLength[object]+1,StringLength[str]]]!=":"<>object,
			StringTake[str,Min[StringLength[object],StringLength[str]]]!=object
		],
		str=Read[file,String]
	];
	
(*	Print["str:",str];*)
		
	(* read entire rest of file, breaking into records at each newline *)
	
	temp=ReadList[file,String,RecordLists->True];
	Close[file];
	If[temp=={},str="";Continue[]];
  
  	(*
	   For Hensel file or Silver (pre v19) file with only a single descriptive
	   line, we want temp[[1]].  For Silver with multiple descriptive
	   lines, we want temp[[2]].  Determine this by checking the first
	   word (ignoring spaces) and checking if all its characters 
	   correspond to either dead or live cells.
	   
	   For Silver v19, we want temp[[1]] with lines not beginning with \t dropped
	*)
	
	(*Print[temp];*)
	
	(* this needs to be fixed up; I'm not sure if it's still needed *)
	
	(*
	t=If[temp[[1,1]]!="" &&
		!(And@@(MemberQ[Join[{" ","\t"},dead,alive],#]&/@
      		Characters[Read[StringToStream[temp[[1,1]]],Word]])),
			temp[[2]],
			temp[[1]]
	];
	*)
	
	t=If[silver,
		Select[temp[[1]],StringTake[#,1]=="\t"&],
		temp[[1]]
	];
	
	(*
	Print[silver];
	Print[temp[[1]]];
	Print[t];
	*)
			
	(* Strip any leading blank lines, then strip any spaces. *)

	str=StringReplace[Select[t,#!=""&],{" "->"","\t"->""}];
	
	(* s is a list of lists of characters, with recognizable ones
	converted to 0s and 1s *)
	
	s=Characters[str] /. Thread[dead->0] /. Thread[alive->1];
		
	(* find lengths of strings up to first non-0|1 entry*)
	
	lengths=Flatten[
    	If[(p=Flatten[Position[#,_String,{1},1]])=={},{Length[#]},p-1]&/@s
    ];
    s=Take[#1,#2]&@@@Transpose[{s,lengths}];
    max=Max[Length/@s];

	(* pad array *)
	cells=Join[#,Table[0,{max-Length[#]}]]&/@s;
  
	If[cells!={},
		If[printfilename,Message[CellMatrix::file,filename[[i]]]];
		Return[cells]
	]
  ];
  Return[$Failed]
]

CellText[l_List?MatrixQ,opts___]:=Module[
	{
    alive=Alive /.{opts} /.Options[CellMatrix],
    dead=Dead /.{opts} /.Options[CellMatrix]
    },
	StringReplace[
		ToString[StringJoin/@(l/.{0->dead[[1]],1->alive[[1]]})],
		{", "->"\n","{"->"","}"->""}
	]
]

