Generation[l_List?MatrixQ,n_Integer?Positive]:=Nest[GenerationNext,l,n]

GenerationNext[l_List?MatrixQ]:=Module[
	{padded=Pad[l],new,lx=Length[l[[1]]],ly=Length[l],i,j,count},
	new=padded;
	count=SurroundCounts[padded];
	Do[
		If[count[[j,i]]<2 || count[[j,i]]>3,new[[j,i]]=0];
		If[count[[j,i]]==3 && padded[[j,i]]==0,new[[j,i]]=1],
			{i,lx+2},{j,ly+2}
	];
	new
]

Generations[l_List?MatrixQ,n0_,p_,chuck_]:=Module[
	{g={},paddedg={},plist={},i,n=n0-1},
	g=NestList[GenerationNext,l,n];
	paddedg=Table[StripBorder[Pad[g[[i+1]],n-i],chuck],{i,0,n}];
	plist=PartitionPad[paddedg,p];
	Flatten[Table[Flatten/@Transpose[plist[[i]]],{i,Length[plist]}],1] 
]

(* rule 224, 2-colors, rules with weights {{2,2,2},{2,1,2},{2,2,2}} *)

Life[m_List?MatrixQ,{g1_Integer?NonNegative,g2_Integer?NonNegative}]:=
  CellularAutomaton[{224,{2,{{2,2,2},{2,1,2},{2,2,2}}},{1,1}},
  {m,0},g2,{{g1,g2},Automatic}] /; g2>=g1

Life[m_List?MatrixQ,g1_Integer:1]:=Life[m,{0,g1}] /; NonNegative[g1]

Life[m_List?MatrixQ,{g1_Integer?NonNegative}]:=Life[m,{g1,g1}]

LifeArray[l_List]:=
  Module[{d=
        Map[Max,Transpose/@Map[Dimensions[Configuration[#]]&,l,{2}],{2}]},
    GraphicsArray[
      Map[
        CellGraphics[
            PadRight[
              PadLeft[Configuration[#[[1]]],{1,1}+#[[2]]],#[[2]]+{2,2}],
            PlotLabel->StyleForm[#[[1]],FontFamily->"Times",
                FontSlant->"Italic"
                ]
            ]&,
        MapIndexed[{#1,d[[#2[[1]]]]}&,l,{2}],{2}]
      ]
    ]
    
