LifeMovie[l_List?MatrixQ,n0_Integer?Positive,padding_:1] := Module[
	{g, bb, paddedg, i, n = n0 - 1}, 
	g = NestList[GenerationNext, l, n];
	paddedg = Table[Pad[g[[i + 1]], n - i], {i, 0, n}];
	bb = ({Min[#1], Max[#1]} & ) /@ Transpose[Position[Plus @@ paddedg, 
        _?(#1 != 0 & )]];
    tightg = (Pad[Take[#1, Sequence @@ bb], padding] & ) /@ paddedg; 
    CellGraphics/@tightg
]

middle[l_List]:=Module[{len=Length[l]},
	Take[l,{2,len-1}]
]

OscillationPeriod::toolarge="Oscillation period greater than `1`."
OscillationPeriod::spaceship="Spaceship with speed c/`1` and \
direction vector `2`."
OscillationPeriod::still="`1`-cell still life starting at generation `2`."
OscillationPeriod::cycle="Beginning of period `1` begins at generation `2`."

OscillationPeriod[m0_List?MatrixQ,opts___]:=Module[
	{
		m=Trim[m0],l,p,pats,offset,gens,
		spaceships=Spaceships /.{opts} /.Options[OscillationPeriod],
		pmax=MaxIterations /.{opts} /.Options[OscillationPeriod]
	},
	l=NestWhileList[Trim[GenerationNext[#]]&,m,UnsameQ,All,pmax+1];
	
	If[Length[l]==pmax+2,
		Message[OscillationPeriod::toolarge,pmax];
		Return[]
	];
	pats=Flatten[Position[l,Last[l]]];
	p=-(Subtract@@pats);
	If[spaceships,gens=NestList[GenerationNext,m,Last[pats]-1]];
	If[!spaceships||(offset=Reverse@Flatten[
		Position[Last[gens],1,{2},1]-Position[gens[[First@pats]],1,{2},1]
		])=={p,p},
		If[p==1,
			Message[OscillationPeriod::still,Bits[Last[l]],First@pats-1],
			If[First@pats==1,p,Message[OscillationPeriod::cycle,p,First@pats-1];p]
		],
		Message[OscillationPeriod::spaceship,
			p/GCD@@(offset-{p,p}),
			offset-{p,p}
		]; If[First@pats==1,p,Message[OscillationPeriod::cycle,p,First@pats-1]]
	]
]

Pad[l_List,{x1_,x2_},{y1_,y2_}]:=
  Module[{x=Join[Table[0,{x1}],#,Table[0,{x2}]]&/@l},
    If[y1>0,x=Join[Table[0,{y1},{x1+x2+Length[l[[1]]]}],x]];
    If[y2>0,x=Join[x,Table[0,{y2},{x1+x2+Length[l[[1]]]}]]];
    x
]

Pad[l_List]:=Pad[l,1]
Pad[l_List,0]:=l
Pad[l_List,n_Integer]:=Pad[l,{n,n},{n,n}]
Pad[l_List,x_Integer,y_Integer]:=Pad[l,{x,x},{y,y}]
Pad[l_List,x_List,y_Integer]:=Pad[l,x,{y,y}]
Pad[l_List,x_Integer,y_List]:=Pad[l,{x,x},y]

