PartitionPad[l_List,n_]:=Module[
	{m=Mod[Length[l],n],p,ly=Length[l[[1]]],lx=Length[l[[1,1]]]},
	p=Partition[l,n];
	If[m==0,p,Append[p,Join[Take[l,-m],Table[Table[0,{ly},{lx}],{n-m}]]]]
]

Square[{x_,y_},r_]:=Polygon[{{x-r,y+r},{x+r,y+r},{x+r,y-r},{x-r,y-r}}]

StillLifeQ[l0_List?MatrixQ]:=Module[{l=Trim[l0]},
	l==Trim[GenerationNext[l]]
]

StripBorder[l_List]:=Module[{},
	Transpose[middle[Transpose[middle[l]]]]
]

StripBorder[l_List,0]:=l
StripBorder[l_List,n_Integer?Positive]:=Nest[StripBorder,l,n]


SurroundCounts[l_List]:=Module[{i,j,di,dj,ly=Length[l],lx=Length[l[[1]]]},
	Table[Sum[l[[j+dj,i+di]],
		{di,If[i==1,0,-1],If[i==lx,0,1]},
		{dj,If[j==1,0,-1],If[j==ly,0,1]}]-l[[j,i]],{j,ly},{i,lx}]
]

(* This can probably be sped up significantly by being much more clever *)

Trim[m_List?MatrixQ]:=Module[{top,left,d=Dimensions[m],zr,zc},
	If[Bits[m]==0,Return[{{0}}]];
    zr=Table[0,{d[[2]]}];
    zc=Table[0,{d[[1]]}];
    Transpose[
      Take[Transpose[
          Take[m,Flatten[
              Through[{First,Last}[Position[m,_?(#!=zr&),1]]]]]],
        Flatten[
          Through[{First,Last}[
              Position[Transpose[m],_?(#!=zc&),1]]]]]]
]

End[]

